import React from 'react';

const VoteUp = (props) => {
	return (
		<button key="vote up button" name="vote up" onClick={this.votesUp}>
			Vote Up!
		</button>
	);
};

votesUp = (event) => {
	console.log(event.target.name, props.comment_id, 'in votesUp');
};

export default VoteUp;
